import React from 'react';
import {
    Avatar,
    Button,
} from '@momentum-ui/react';

class Review extends React.Component {
    constructor() {
        super();
    }

    render() {
        const hideGrid = {
            background:'transparent',
            borderColor:'transparent'
        };

        return (
            <div className="show-grid" style={{paddingTop:20}}>
            <div className="row">
                <div className="columns large-10" style={hideGrid}>
                    <p>Please review the information for the class to finish the set-up process.</p>
                </div>
            </div>
            </div>
        );
    }
}

export default Review;
